INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 1, 0, 1, 0, 0, 60000, "", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 1, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60000, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60000, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 1, 0, 60000, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60000, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 5, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60000, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 6, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 2, 0, 60000, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 7, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60000, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 8, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60000, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 9, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60000, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 10, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60000, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 11, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 3, 0, 60000, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 12, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60000, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 13, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60000, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 14, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60000, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 15, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60000, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 16, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 4, 0, 60000, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 17, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 0, 3, 0, 0, 60000, "", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 18, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 7, 3, 0, 0, 60000, "", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 190804, 19, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ハツネ", 0, 1, 0, 0, 0, 80001, "", "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 101201, 20, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ハツネ", 0, 1, 0, 0, 0, 80001, "", "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 101201, 21, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シオリ", 0, 1, 1, 0, 0, 80001, "", "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 103801, 22, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シオリ", 0, 1, 1, 0, 0, 80001, "", "来年も、\n一緒にいられたら…\nうれしいな", 103801, 23, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キョウカ", 0, 2, 0, 0, 0, 80001, "", "あなたと一緒にいるようになって、\nもう1年ですか…", 103601, 24, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キョウカ", 0, 2, 0, 0, 0, 80001, "", "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 103601, 25, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミミ", 0, 2, 1, 0, 0, 80001, "", "おにいちゃんとあってから、\n1年たったよ～！", 102001, 26, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミミ", 0, 2, 1, 0, 0, 80001, "", "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 102001, 27, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミソギ", 0, 2, 2, 0, 0, 80001, "", "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 100401, 28, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミソギ", 0, 2, 2, 0, 0, 80001, "", "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 100401, 29, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("マホ", 0, 3, 0, 0, 0, 80001, "", "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 101001, 30, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("マホ", 0, 3, 0, 0, 0, 80001, "", "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 101001, 31, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("イリヤ", 0, 3, 1, 0, 0, 80001, "", "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 104401, 32, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("イリヤ", 0, 3, 1, 0, 0, 80001, "", "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 104401, 33, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カオリ", 0, 3, 2, 0, 0, 80001, "", "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 101701, 34, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カオリ", 0, 3, 2, 0, 0, 80001, "", "これからも、どうぞよろしく\nお願いするさ～！", 101701, 35, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("サレン", 0, 4, 0, 0, 0, 80001, "", "あんたと出会ってからもうそんなに\nたつのね～", 102801, 36, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("サレン", 0, 4, 0, 0, 0, 80001, "", "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 102801, 37, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("スズメ", 0, 4, 1, 0, 0, 80001, "", "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 102501, 38, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("スズメ", 0, 4, 1, 0, 0, 80001, "", "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 102501, 39, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("タマキ", 0, 5, 0, 0, 0, 80001, "", "振り返れば、今までいろんなことが\nあったにゃあ…", 104601, 40, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("タマキ", 0, 5, 0, 0, 0, 80001, "", "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 104601, 41, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミフユ", 0, 5, 1, 0, 0, 80001, "", "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 104801, 42, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミフユ", 0, 5, 1, 0, 0, 80001, "", "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 104801, 43, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("アキノ", 0, 6, 0, 0, 0, 80001, "", "あなたさまと出会ってもう1年…", 103201, 44, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("アキノ", 0, 6, 0, 0, 0, 80001, "", "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 103201, 45, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ユカリ", 0, 6, 1, 0, 0, 80001, "", "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 103401, 46, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ユカリ", 0, 6, 1, 0, 0, 80001, "", "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 103401, 47, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("クリスティーナ", 0, 7, 0, 0, 0, 80001, "", "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 107101, 48, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("クリスティーナ", 0, 7, 0, 0, 0, 80001, "", "ともかくこれからも\n愉しませてくれよ☆", 107101, 49, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ジュン", 0, 7, 1, 0, 0, 80001, "", "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 104701, 50, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ジュン", 0, 7, 1, 0, 0, 80001, "", "見えないから分からないって？\nそれもそうだな…", 104701, 51, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("トモ", 0, 8, 0, 0, 0, 80001, "", "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 103701, 52, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("トモ", 0, 8, 0, 0, 0, 80001, "", "これからもよろしくね！", 103701, 53, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("マツリ", 0, 8, 1, 0, 0, 80001, "", "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 100501, 54, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("マツリ", 0, 8, 1, 0, 0, 80001, "", "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 100501, 55, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミヤコ", 0, 9, 0, 0, 0, 80001, "", "オマエと会って1年なの！\n全然成仏もできなかったし、", 100701, 56, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミヤコ", 0, 9, 0, 0, 0, 80001, "", "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 100701, 57, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シノブ", 0, 9, 1, 0, 0, 80001, "", "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 103101, 58, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シノブ", 0, 9, 1, 0, 0, 80001, "", "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 103101, 59, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("アンナ", 0, 10, 0, 0, 0, 80001, "", "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 100901, 60, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("アンナ", 0, 10, 0, 0, 0, 80001, "", "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 100901, 61, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ナナカ", 0, 10, 1, 0, 0, 80001, "", "君と出会ってもう1年だって！\n早いねー！", 101301, 62, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ナナカ", 0, 10, 1, 0, 0, 80001, "", "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 101301, 63, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミツキ", 0, 11, 0, 0, 0, 80001, "", "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 105101, 64, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ミツキ", 0, 11, 0, 0, 0, 80001, "", "これからも、いろんなところを\n調べさせてね？", 105101, 65, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ルカ", 0, 11, 1, 0, 0, 80001, "", "お前さんと出会ってもう1年か\n助太刀するつもりが", 105601, 66, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ルカ", 0, 11, 1, 0, 0, 80001, "", "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 105601, 67, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("エリコ", 0, 11, 2, 0, 0, 80001, "", "早いものですわね、あなた様と\nお会いして、もう1年…", 102701, 68, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("エリコ", 0, 11, 2, 0, 0, 80001, "", "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 102701, 69, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("アヤネ", 0, 12, 0, 0, 0, 80001, "", "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 102301, 70, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("アヤネ", 0, 12, 0, 0, 0, 80001, "", "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 102301, 71, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("チカ", 0, 12, 1, 0, 0, 80001, "", "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 104201, 72, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("チカ", 0, 12, 1, 0, 0, 80001, "", "私のことを見守ってください\nできることなら、ずっと…", 104201, 73, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("クルミ", 0, 12, 2, 0, 0, 80001, "", "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 102101, 74, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("クルミ", 0, 12, 2, 0, 0, 80001, "", "で、でもこれからもずっと…\n一緒にいたいなぁ…", 102101, 75, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シズル", 0, 13, 0, 0, 0, 80001, "", "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 104901, 76, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シズル", 0, 13, 0, 0, 0, 80001, "", "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 104901, 77, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("リノ", 0, 13, 1, 0, 0, 80001, "", "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 101101, 78, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("リノ", 0, 13, 1, 0, 0, 80001, "", "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 101101, 79, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ユイ", 0, 14, 0, 0, 0, 80001, "", "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 100201, 80, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ユイ", 0, 14, 0, 0, 0, 80001, "", "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 100201, 81, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ヒヨリ", 0, 14, 1, 0, 0, 80001, "", "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 100101, 82, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ヒヨリ", 0, 14, 1, 0, 0, 80001, "", "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 100101, 83, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("レイ", 0, 14, 2, 0, 0, 80001, "", "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 100301, 84, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("レイ", 0, 14, 2, 0, 0, 80001, "", "キミに背中を預けられる日が、\n早くきますように", 100301, 85, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80001, "", "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 105801, 86, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80001, "", "これからもずっと、覚えていて\nくださいね！", 105801, 87, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 1, 0, 0, 80001, "", "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 105901, 88, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 1, 0, 0, 80001, "", "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 105901, 89, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80001, "", "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 106001, 90, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80001, "", "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 106001, 91, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("スズメ", 1, 0, 1, 0, 0, 60001, "", "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 112101, 92, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60001, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 93, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60001, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 94, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60001, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 95, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60001, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 96, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 1, 0, 60001, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 97, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60001, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 98, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60001, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 99, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60001, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 100, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60001, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 101, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 2, 0, 60001, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 102, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60001, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 103, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60001, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 104, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60001, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 105, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60001, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 106, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60001, "", "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 107, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60001, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 108, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 3, 0, 60001, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 109, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60001, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 110, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60001, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 111, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60001, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 112, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60001, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 113, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60001, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 114, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60001, "", "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 115, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 4, 0, 60001, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 116, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("スズメ", 0, 0, 3, 0, 0, 60001, "", "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 112101, 117, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("スズメ", 0, 7, 3, 0, 0, 60001, "", "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 112101, 118, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 1, 0, 0, 0, 80003, "", "ヒューヒュー♪\nドンドンパフパフー♪", 105801, 119, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 1, 1, 0, 0, 80003, "", "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 105901, 120, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 1, 1, 0, 0, 80003, "", "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 105901, 121, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 1, 2, 0, 0, 80003, "", "え？　ちょっと\nいきなりなにっ？", 106001, 122, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 1, 2, 0, 0, 80003, "", "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 106001, 123, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 1, 0, 0, 0, 80003, "", "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 105801, 124, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 1, 0, 0, 0, 80003, "", "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 105801, 125, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 1, 1, 0, 0, 80003, "", "ですからその日に向けて\n今から気分を盛り上げているのです", 105901, 126, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 1, 2, 0, 0, 80003, "", "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 106001, 127, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 1, 1, 0, 0, 80003, "", "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 105901, 128, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 1, 0, 0, 0, 80003, "", "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 105801, 129, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 1, 2, 0, 0, 80003, "", "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 106001, 130, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 1, 1, 0, 0, 80003, "", "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 105901, 131, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80003, "", "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 106001, 132, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 2, 1, 0, 0, 80003, "", "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 190801, 133, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80003, "", "げっ…カリンじゃない\nなんでもないわよ！", 106001, 134, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 2, 1, 0, 0, 80003, "", "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 190801, 135, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80003, "", "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 106001, 136, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 2, 1, 0, 0, 80003, "", "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 190801, 137, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80003, "", "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 106001, 138, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80003, "", "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 106001, 139, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 2, 1, 0, 0, 80003, "", "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 190801, 140, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80003, "", "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 106001, 141, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 2, 1, 0, 0, 80003, "", "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 190801, 142, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80003, "", "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 106001, 143, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 0, 0, 0, 80003, "", "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 105901, 144, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 1, 0, 0, 80003, "", "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 105801, 145, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 0, 0, 0, 80003, "", "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 105901, 146, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 0, 0, 0, 80003, "", "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 105901, 147, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 1, 0, 0, 80003, "", "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 105801, 148, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 1, 0, 0, 80003, "", "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 105801, 149, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 0, 0, 0, 80003, "", "あとは、牧場に素敵な温泉が\n出来たとか…", 105901, 150, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 1, 0, 0, 80003, "", "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 105801, 151, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 0, 0, 0, 80003, "", "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 105901, 152, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 1, 0, 0, 80003, "", "えへへ、ありがとうございます\nコッコロちゃん！", 105801, 153, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 0, 0, 0, 80003, "", "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 105901, 154, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 1, 0, 0, 80003, "", "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 105801, 155, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 4, 0, 0, 0, 80003, "", "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 105801, 156, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 1, 0, 0, 80003, "", "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 106001, 157, 12);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 4, 0, 0, 0, 80003, "", "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 105801, 158, 12);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 1, 0, 0, 80003, "", "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 106001, 159, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 4, 0, 0, 0, 80003, "", "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 105801, 160, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 1, 0, 0, 80003, "", "…積極的？\nなんの話よ？", 106001, 161, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 4, 0, 0, 0, 80003, "", "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 105801, 162, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 4, 0, 0, 0, 80003, "", "ムーサの町で\nきゃるきゃる～ん☆　って！", 105801, 163, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 1, 0, 0, 80003, "", "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 106001, 164, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 4, 0, 0, 0, 80003, "", "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 105801, 165, 16);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 1, 0, 0, 80003, "", "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 106001, 166, 16);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 1, 0, 0, 80003, "", "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 106001, 167, 17);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80003, "", "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 106001, 168, 18);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 5, 1, 0, 0, 80003, "", "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 105901, 169, 12);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80003, "", "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 106001, 170, 19);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 5, 1, 0, 0, 80003, "", "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 105901, 171, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80003, "", "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 106001, 172, 20);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 5, 1, 0, 0, 80003, "", "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 105901, 173, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80003, "", "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 106001, 174, 21);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 5, 1, 0, 0, 80003, "", "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 105901, 175, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80003, "", "かくし芸？", 106001, 176, 22);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 5, 1, 0, 0, 80003, "", "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 105901, 177, 16);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80003, "", "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 106001, 178, 23);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 6, 0, 0, 0, 80003, "", "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 105801, 179, 17);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 2, 0, 0, 80003, "", "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 106001, 180, 24);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 6, 1, 0, 0, 80003, "", "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 105901, 181, 17);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 6, 0, 0, 0, 80003, "", "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 105801, 182, 18);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 2, 0, 0, 80003, "", "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 106001, 183, 25);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 6, 1, 0, 0, 80003, "", "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 105901, 184, 18);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 2, 0, 0, 80003, "", "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 106001, 185, 26);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 2, 0, 0, 80003, "", "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 106001, 186, 27);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 2, 0, 0, 80003, "", "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 106001, 187, 28);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 6, 0, 0, 0, 80003, "", "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 105801, 188, 19);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 6, 1, 0, 0, 80003, "", "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 105901, 189, 19);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 2, 0, 0, 80003, "", "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 106001, 190, 29);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 106001, 191, 30);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 106001, 192, 31);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 106001, 193, 32);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "あー\nあー\n…声、これで大丈夫かしら？", 106001, 194, 33);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 106001, 195, 34);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "オイッスー☆", 106001, 196, 35);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "……\nいや、ないわ\nいつもどおりが一番ね、うん", 106001, 197, 36);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 106001, 198, 37);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80003, "", "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 106001, 199, 38);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 105901, 200, 20);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 105901, 201, 21);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 105901, 202, 22);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 105901, 203, 23);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 105901, 204, 24);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "オイッスー☆", 105901, 205, 25);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 105901, 206, 26);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 105901, 207, 27);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 0, 0, 0, 80003, "", "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 105901, 208, 28);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "オイッスー☆", 105801, 209, 20);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 105801, 210, 21);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "あと６日で2.5周年ですか…", 105801, 211, 22);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 105801, 212, 23);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 105801, 213, 24);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "オイッスー☆", 105801, 214, 25);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 105801, 215, 26);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 105801, 216, 27);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 105801, 217, 28);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 105801, 218, 29);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 9, 0, 0, 0, 80003, "", "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 105801, 219, 30);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 10, 0, 0, 0, 80003, "", "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 105801, 220, 31);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 1, 0, 0, 80003, "", "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 105901, 221, 29);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 10, 0, 0, 0, 80003, "", "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 105801, 222, 32);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 10, 2, 0, 0, 80003, "", "…………", 106001, 223, 39);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 1, 0, 0, 80003, "", "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 105901, 224, 30);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 10, 2, 0, 0, 80003, "", "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 106001, 225, 40);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 10, 0, 0, 0, 80003, "", "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 105801, 226, 33);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 10, 2, 0, 0, 80003, "", "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 106001, 227, 41);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 10, 0, 0, 0, 80003, "", "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 105801, 228, 34);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 10, 0, 0, 0, 80003, "", "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 105801, 229, 35);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 10, 2, 0, 0, 80003, "", "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 106001, 230, 42);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 1, 0, 0, 80003, "", "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 105901, 231, 31);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 10, 2, 0, 0, 80003, "", "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 106001, 232, 43);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 10, 0, 0, 0, 80003, "", "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 105801, 233, 36);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 190801, 234, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 190801, 235, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 190801, 236, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 190801, 237, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 190801, 238, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "次にコッコロさんですが\nこちらは発声練習をしています", 190801, 239, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 190801, 240, 12);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 190801, 241, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "あれ？\nもしかして緊張で気を失って…？", 190801, 242, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 190801, 243, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 190801, 244, 16);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 11, 0, 0, 0, 80003, "", "それでは\nまた明日お会いしましょう♪", 190801, 245, 17);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 12, 0, 0, 0, 80003, "", "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 106001, 246, 44);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 12, 2, 0, 0, 80003, "", "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 105801, 247, 37);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 12, 1, 0, 0, 80003, "", "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 105901, 248, 32);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 12, 0, 0, 0, 80003, "", "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 106001, 249, 45);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 12, 2, 0, 0, 80003, "", "ひどいですよぉキャルちゃ～ん！", 105801, 250, 38);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 12, 1, 0, 0, 80003, "", "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 105901, 251, 33);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 12, 2, 0, 0, 80003, "", "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 105801, 252, 39);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 12, 0, 0, 0, 80003, "", "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 106001, 253, 46);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 12, 1, 0, 0, 80003, "", "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 105901, 254, 34);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 12, 2, 0, 0, 80003, "", "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 105801, 255, 40);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 13, 0, 0, 0, 80003, "", "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 105801, 256, 41);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 2, 0, 0, 80003, "", "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 106001, 257, 47);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 13, 0, 0, 0, 80003, "", "忘れてきちゃいました☆", 105801, 258, 42);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 2, 0, 0, 80003, "", "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 106001, 259, 48);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 13, 1, 0, 0, 80003, "", "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 105901, 260, 35);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 2, 0, 0, 80003, "", "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 106001, 261, 49);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 13, 0, 0, 0, 80003, "", "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 105801, 262, 43);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 2, 0, 0, 80003, "", "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 106001, 263, 50);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 13, 1, 0, 0, 80003, "", "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 105901, 264, 36);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 2, 0, 0, 80003, "", "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 106001, 265, 51);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 13, 1, 0, 0, 80003, "", "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 105901, 266, 37);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 2, 0, 0, 80003, "", "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 106001, 267, 52);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 13, 0, 0, 0, 80003, "", "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 105801, 268, 44);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 13, 1, 0, 0, 80003, "", "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 105901, 269, 38);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 13, 0, 0, 0, 80003, "", "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 105801, 270, 45);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 2, 0, 0, 80003, "", "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 106001, 271, 53);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 13, 0, 0, 0, 80003, "", "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 105801, 272, 46);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "こんにちは\n【ギルド管理協会】のカリンです", 190801, 273, 18);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "昨日の生放送は\nいかがだったでしょうか？", 190801, 274, 19);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 190801, 275, 20);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 190801, 276, 21);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 190801, 277, 22);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 190801, 278, 23);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 190801, 279, 24);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 190801, 280, 25);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 190801, 281, 26);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 14, 0, 0, 0, 80003, "", "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 190801, 282, 27);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80003, "", "準備はいいですかっ？\n…いっきますよー！", 105801, 283, 47);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80003, "", "祝！", 106001, 284, 54);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 1, 0, 0, 80003, "", "2.5周年！", 105901, 285, 39);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80003, "", "おめでとうございま～す☆", 105801, 286, 48);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80003, "", "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 106001, 287, 55);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 1, 0, 0, 80003, "", "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 105901, 288, 40);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80003, "", "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 105801, 289, 49);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80003, "", "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 106001, 290, 56);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 1, 0, 0, 80003, "", "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 105901, 291, 41);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80003, "", "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 106001, 292, 57);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80003, "", "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 105801, 293, 50);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80003, "", "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 106001, 294, 58);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80003, "", "記念日だから\n平気平気♪\nやばいですね☆", 105801, 295, 51);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80003, "", "意味分かんないわよ！", 106001, 296, 59);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 1, 0, 0, 80003, "", "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 105901, 297, 42);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 1, 0, 0, 80003, "", "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 105901, 298, 43);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80003, "", "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 105801, 299, 52);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 2, 0, 0, 80003, "", "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 106001, 300, 60);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 1, 0, 0, 80003, "", "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 105901, 301, 44);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 0, 0, 0, 80003, "", "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 105801, 302, 53);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ・コッコロ・キャル", 0, 15, 0, 0, 1, 80003, "105901,45,106001,61", "2.5周年\nありがとうございます！", 105801, 303, 54);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 1, 0, 1, 0, 0, 60002, "", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 304, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60002, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 305, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60002, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 306, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60002, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 307, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60002, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 308, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 1, 0, 60002, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 309, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60002, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 310, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60002, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 311, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60002, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 312, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60002, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 313, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 2, 0, 60002, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 314, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60002, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 315, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60002, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 316, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60002, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 317, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60002, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 318, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60002, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 319, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60002, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 320, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 3, 0, 60002, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 321, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60002, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 322, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60002, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 323, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60002, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 324, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60002, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 325, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60002, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 326, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60002, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 327, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 4, 0, 60002, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 328, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 0, 3, 0, 0, 60002, "", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 329, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 7, 3, 0, 0, 60002, "", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 190804, 330, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 1, 4, 0, 0, 80005, "", "ささ、シェフィさまはこちらへ…", 105901, 331, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 1, 0, 0, 0, 80005, "", "コッコロさん、どこへ行くの…？\n…え？", 106401, 332, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 1, 3, 0, 0, 80005, "", "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 105801, 333, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 1, 4, 0, 0, 80005, "", "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 105901, 334, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 1, 0, 0, 0, 80005, "", "ええと…\n二人とも何をしているの？", 106401, 335, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 1, 1, 0, 0, 80005, "", "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 106001, 336, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 1, 0, 0, 0, 80005, "", "あの日…？", 106401, 337, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 1, 3, 0, 0, 80005, "", "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 105801, 338, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 1, 3, 0, 0, 80005, "", "『プリンセスコネクト！\nRe:Dive』3.5周年！", 105801, 339, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 1, 2, 0, 0, 80005, "", "やばいですね☆", 190801, 340, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 1, 1, 0, 0, 80005, "", "って、なにしれっと\n参加してんのよカリン！", 106001, 341, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 1, 2, 0, 0, 80005, "", "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 190801, 342, 2);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 1, 2, 0, 0, 80005, "", "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 190801, 343, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 1, 3, 0, 0, 80005, "", "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 105801, 344, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 1, 0, 0, 0, 80005, "", "えっ！？　ええとええと…！\nあ、あと14日…！", 106401, 345, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 2, 3, 0, 0, 80005, "", "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 105801, 346, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 2, 1, 0, 0, 80005, "", "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 105901, 347, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 2, 1, 0, 0, 80005, "", "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 105901, 348, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 2, 3, 0, 0, 80005, "", "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 105801, 349, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 2, 1, 0, 0, 80005, "", "さすがでございます\nペコリーヌさま", 105901, 350, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80005, "", "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 106001, 351, 3);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 2, 2, 0, 0, 80005, "", "しゃなり、しゃなり…\nふふ、案外できるものね", 106401, 352, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 2, 3, 0, 0, 80005, "", "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 105801, 353, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 2, 1, 0, 0, 80005, "", "さ、次はキャルさまの\n番でございますよ", 105901, 354, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80005, "", "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 106001, 355, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 2, 2, 0, 0, 80005, "", "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 106401, 356, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80005, "", "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 106001, 357, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80005, "", "いたたた…もぉお～！\nなんであたしがこんな目に～！", 106001, 358, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 2, 1, 0, 0, 80005, "", "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 105901, 359, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 2, 0, 0, 0, 80005, "", "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 106001, 360, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 1, 0, 0, 80005, "", "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 105901, 361, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 3, 0, 0, 80005, "", "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 105801, 362, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 1, 0, 0, 80005, "", "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 105901, 363, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 3, 2, 0, 0, 80005, "", "聖学祭…って、なにかしら？", 106401, 364, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 3, 1, 0, 0, 80005, "", "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 105901, 365, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 3, 0, 0, 0, 80005, "", "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 106001, 366, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 3, 0, 0, 0, 80005, "", "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 106001, 367, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 3, 0, 0, 80005, "", "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 105801, 368, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 3, 0, 0, 0, 80005, "", "いや、そのまんますぎでしょ…", 106001, 369, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 3, 2, 0, 0, 80005, "", "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 106401, 370, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 3, 3, 0, 0, 80005, "", "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 105801, 371, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 3, 2, 0, 0, 80005, "", "えっ？　ええ…\nぎゅーっ…？", 106401, 372, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 0, 0, 0, 80005, "", "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 106001, 373, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 4, 2, 0, 0, 80005, "", "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 106401, 374, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 0, 0, 0, 80005, "", "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 106001, 375, 12);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 4, 1, 0, 0, 80005, "", "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 105901, 376, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 0, 0, 0, 80005, "", "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 106001, 377, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 4, 3, 0, 0, 80005, "", "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 105801, 378, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 0, 0, 0, 80005, "", "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 106001, 379, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 0, 0, 0, 80005, "", "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 106001, 380, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 4, 2, 0, 0, 80005, "", "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 106401, 381, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 4, 3, 0, 0, 80005, "", "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 105801, 382, 12);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 4, 1, 0, 0, 80005, "", "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 105901, 383, 12);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 4, 0, 0, 0, 80005, "", "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 106001, 384, 16);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 4, 2, 0, 0, 80005, "", "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 106401, 385, 12);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 5, 3, 0, 0, 80005, "", "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 105801, 386, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 5, 3, 0, 0, 80005, "", "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 105801, 387, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 5, 3, 0, 0, 80005, "", "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 105801, 388, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80005, "", "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 106001, 389, 17);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80005, "", "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 106001, 390, 18);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 5, 2, 0, 0, 80005, "", "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 106401, 391, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 5, 1, 0, 0, 80005, "", "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 105901, 392, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 5, 3, 0, 0, 80005, "", "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 105801, 393, 16);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 5, 0, 0, 0, 80005, "", "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 106001, 394, 19);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 5, 3, 0, 0, 80005, "", "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 105801, 395, 17);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 5, 3, 0, 0, 80005, "", "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 105801, 396, 18);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 5, 3, 0, 0, 80005, "", "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 105801, 397, 19);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 6, 2, 0, 0, 80005, "", "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 190801, 398, 4);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 6, 2, 0, 0, 80005, "", "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 190801, 399, 5);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 1, 0, 0, 80005, "", "…えっ！？", 106001, 400, 20);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 6, 3, 0, 0, 80005, "", "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 105801, 401, 20);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 6, 0, 0, 0, 80005, "", "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 106401, 402, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 6, 4, 0, 0, 80005, "", "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 105901, 403, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 6, 0, 0, 0, 80005, "", "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 106401, 404, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 1, 0, 0, 80005, "", "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 106001, 405, 21);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 6, 3, 0, 0, 80005, "", "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 105801, 406, 21);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 6, 1, 0, 0, 80005, "", "ぶっ殺すぞ！？", 106001, 407, 22);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 6, 2, 0, 0, 80005, "", "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 190801, 408, 6);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 7, 1, 0, 0, 80005, "", "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 105901, 409, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80005, "", "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 106001, 410, 23);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 7, 2, 0, 0, 80005, "", "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 106401, 411, 16);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 7, 3, 0, 0, 80005, "", "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 105801, 412, 22);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80005, "", "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 106001, 413, 24);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 7, 2, 0, 0, 80005, "", "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 106401, 414, 17);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 7, 1, 0, 0, 80005, "", "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 105901, 415, 16);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 7, 2, 0, 0, 80005, "", "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 106401, 416, 18);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 7, 1, 0, 0, 80005, "", "もちろんでございます\n仲良くお勉強いたしましょう", 105901, 417, 17);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80005, "", "しれっと教育ママが\n生まれてる…？", 106001, 418, 25);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 7, 3, 0, 0, 80005, "", "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 105801, 419, 23);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 7, 0, 0, 0, 80005, "", "え～～～～！？", 106001, 420, 26);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 8, 0, 0, 0, 80005, "", "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 106001, 421, 27);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 8, 2, 0, 0, 80005, "", "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 106401, 422, 19);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 1, 0, 0, 80005, "", "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 105901, 423, 18);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 8, 3, 0, 0, 80005, "", "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 105801, 424, 24);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 8, 2, 0, 0, 80005, "", "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 106401, 425, 20);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 8, 0, 0, 0, 80005, "", "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 106001, 426, 28);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 8, 1, 0, 0, 80005, "", "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 105901, 427, 19);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 8, 2, 0, 0, 80005, "", "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 106401, 428, 21);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 8, 0, 0, 0, 80005, "", "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 106001, 429, 29);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 8, 0, 0, 0, 80005, "", "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 106001, 430, 30);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 8, 3, 0, 0, 80005, "", "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 105801, 431, 25);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 8, 0, 0, 0, 80005, "", "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 106001, 432, 31);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 106401, 433, 22);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "…えっ？\n生放送の意気込み！？\n突然なに！？", 106401, 434, 23);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 106401, 435, 24);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 106401, 436, 25);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 106401, 437, 26);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "それから、それから…！\nぅ、ぅぅっ…！", 106401, 438, 27);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "―びえぇぇ～んっ！！！", 106401, 439, 28);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 9, 1, 0, 0, 80005, "", "どうされましたか、シェフィさま", 105901, 440, 20);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "ううっ…ひっく…\nママッ…！", 106401, 441, 29);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 9, 1, 0, 0, 80005, "", "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 105901, 442, 21);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 9, 1, 0, 0, 80005, "", "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 105901, 443, 22);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 9, 0, 0, 0, 80005, "", "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 106401, 444, 30);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "主さま\n3.5周年まであと５日\nでございます", 105901, 445, 23);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "ですがその前に\n生放送がありますね", 105901, 446, 24);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "…生放送に向けた\n意気込みでございますか？", 105901, 447, 25);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 105901, 448, 26);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 105901, 449, 27);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 105901, 450, 28);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 105901, 451, 29);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 105901, 452, 30);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 10, 0, 0, 0, 80005, "", "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 105901, 453, 31);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 11, 0, 0, 0, 80005, "", "3.5周年まであと４日！\nやばいですね☆", 105801, 454, 26);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 11, 1, 0, 0, 80005, "", "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 106001, 455, 32);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 11, 0, 0, 0, 80005, "", "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 105801, 456, 27);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 11, 0, 0, 0, 80005, "", "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 105801, 457, 28);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 11, 0, 0, 0, 80005, "", "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 105801, 458, 29);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 11, 1, 0, 0, 80005, "", "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 106001, 459, 33);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 11, 0, 0, 0, 80005, "", "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 105801, 460, 30);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 11, 0, 0, 0, 80005, "", "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 105801, 461, 31);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 11, 0, 0, 0, 80005, "", "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 105801, 462, 32);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 11, 1, 0, 0, 80005, "", "だからあたしはやるなんて一言も…", 106001, 463, 34);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 11, 0, 0, 0, 80005, "", "オイッスー☆", 105801, 464, 33);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 11, 1, 0, 0, 80005, "", "聞きなさいっての！！", 106001, 465, 35);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 12, 2, 0, 0, 80005, "", "3.5周年まであと３日…\nそして生放送は、明日…", 106401, 466, 31);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 12, 2, 0, 0, 80005, "", "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 106401, 467, 32);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 12, 2, 0, 0, 80005, "", "おいっす！\n…こうじゃなかったわね\nええと確か…", 106401, 468, 33);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 12, 2, 0, 0, 80005, "", "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 106401, 469, 34);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 12, 2, 0, 0, 80005, "", "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 106401, 470, 35);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 12, 3, 0, 0, 80005, "", "やってますねシェフィちゃん！", 105801, 471, 34);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 12, 0, 0, 0, 80005, "", "なによ、考えることは\nみんな同じってこと？", 106001, 472, 36);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 12, 1, 0, 0, 80005, "", "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 105901, 473, 32);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 12, 2, 0, 0, 80005, "", "みんな…もちろんよ！", 106401, 474, 36);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 12, 3, 0, 0, 80005, "", "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 105801, 475, 35);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 13, 2, 0, 0, 80005, "", "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 190801, 476, 7);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 13, 2, 0, 0, 80005, "", "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 190801, 477, 8);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 13, 3, 0, 0, 80005, "", "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 105801, 478, 36);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 13, 2, 0, 0, 80005, "", "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 190801, 479, 9);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 13, 4, 0, 0, 80005, "", "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 105901, 480, 33);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 13, 2, 0, 0, 80005, "", "さすが【美食殿】のママですね！\nそしてキャルさんは…", 190801, 481, 10);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 1, 0, 0, 80005, "", "大丈夫…大丈夫…\nあたしは大丈夫…", 106001, 482, 37);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 13, 2, 0, 0, 80005, "", "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 190801, 483, 11);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 13, 0, 0, 0, 80005, "", "あうー？", 106401, 484, 37);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("みんな", 0, 13, 4, 0, 1, 80005, "105901,34,106001,38,190801,12", "あ…", 105801, 485, 37);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 13, 1, 0, 0, 80005, "", "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 106001, 486, 39);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 13, 4, 0, 0, 80005, "", "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 105901, 487, 35);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 13, 3, 0, 0, 80005, "", "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 105801, 488, 38);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 13, 2, 0, 0, 80005, "", "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 190801, 489, 13);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 14, 2, 0, 0, 80005, "", "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 106401, 490, 38);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 14, 3, 0, 0, 80005, "", "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 105801, 491, 39);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 14, 0, 0, 0, 80005, "", "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 106001, 492, 40);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 14, 1, 0, 0, 80005, "", "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 105901, 493, 36);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 14, 2, 0, 0, 80005, "", "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 106401, 494, 39);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 14, 3, 0, 0, 80005, "", "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 105801, 495, 40);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 14, 1, 0, 0, 80005, "", "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 105901, 496, 37);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 14, 0, 0, 0, 80005, "", "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 106001, 497, 41);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 14, 2, 0, 0, 80005, "", "へ、へぇ…", 106401, 498, 40);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 14, 3, 0, 0, 80005, "", "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 105801, 499, 41);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 14, 2, 0, 0, 80005, "", "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 106401, 500, 41);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 14, 2, 0, 0, 80005, "", "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 106401, 501, 42);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 3, 0, 0, 80005, "", "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 105801, 502, 42);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 1, 0, 0, 80005, "", "祝！", 106001, 503, 42);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 4, 0, 0, 80005, "", "3.5周年！", 105901, 504, 38);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 15, 0, 0, 0, 80005, "", "おめでとうございます！", 106401, 505, 43);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 15, 2, 0, 0, 80005, "", "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 190801, 506, 14);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 0, 15, 2, 0, 0, 80005, "", "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 190801, 507, 15);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 3, 0, 0, 80005, "", "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 105801, 508, 43);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 3, 0, 0, 80005, "", "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 105801, 509, 44);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 1, 0, 0, 80005, "", "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 106001, 510, 43);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャル", 0, 15, 1, 0, 0, 80005, "", "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 106001, 511, 44);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 15, 0, 0, 0, 80005, "", "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 106401, 512, 44);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィ", 0, 15, 0, 0, 0, 80005, "", "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 106401, 513, 45);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 4, 0, 0, 80005, "", "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 105901, 514, 39);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 4, 0, 0, 80005, "", "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 105901, 515, 40);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロ", 0, 15, 4, 0, 0, 80005, "", "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 105901, 516, 41);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌ", 0, 15, 3, 0, 0, 80005, "", "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 105801, 517, 45);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("みんな", 0, 15, 4, 0, 1, 80005, "105901,42,106001,45,106401,46,190801,16", "これからも\nよろしくおねがいします！", 105801, 518, 46);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カリン", 1, 0, 1, 0, 0, 60003, "", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 519, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60003, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 520, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60003, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 521, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60003, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 522, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 1, 0, 60003, "", "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 523, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 1, 0, 60003, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 524, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60003, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 525, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60003, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 526, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60003, "", "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 527, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 2, 0, 60003, "", "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 528, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 2, 0, 60003, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 529, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60003, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 530, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60003, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 531, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60003, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 532, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60003, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 533, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60003, "", "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 534, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 3, 0, 60003, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 535, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 2, 0, 2, 3, 0, 60003, "", "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 536, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("", 1, 0, 2, 4, 0, 60003, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 537, 0);
